import React from "react";

import "../stylesheets/SpotifyButton.css";

type LoginProps = {
  login: () => void;
};

export default function Login({ login }: LoginProps) {
  return (
    <div className="d-flex justify-content-center">
      <h1 className="spotify-header-white">Spotify MTV</h1>
      <button className="btn spotify-button-green m-5" onClick={() => login()}>
        LOG IN WITH SPOTIFY
      </button>
    </div>
  );
}
